import React, { Component } from 'react';
import { Text, View } from 'react-native';

class ChatNavigatorScreen extends Component {


  async viewChats() {
    try {
      const response = await fetch('http://localhost:3333/api/1.0.0/chats', {
        method: 'GET',
        headers: {
          'X-Authorisation': await AsyncStorage.getItem('whatsthat_session_token'),
          'Content-Type': 'application/json',
        },
      });

      if (response.status === 200) {
        const chats = await response.json();
        this.setState({ chats: chats });
      } else if (response.status === 401) {
        console.log('Unathorised');
        await AsyncStorage.removeItem('whatsthat_session_token');
        await AsyncStorage.removeItem('whatsthat_user_id');
        this.props.navigation.navigate('Login');
      } else {
        throw 'Server Error';
      }
    } catch (error) {
      this.setState({ error: error });
    }
  }

  render() {
    return (
      <View>
        <Text>This is the Add Contacts screen</Text>
      </View>
    );
  }
}

export default ChatNavigatorScreen;
